import React, {useState, useEffect} from 'react';
import './App.css';

function App() {
    const[data, setData] = useState([]);
    useEffect(()=>{
        const fetchData= async() => {
            const result = await fetch("https://orangevalleycaa.org/api/videos").then(
                response=> response.json()
            )
            setData(result);
        }
        fetchData();
    },[]);
  return (
    <div className="App">
      <header>
        <h1>videos</h1>
      </header>
        {data.map()}
    </div>
  );
}

export default App;
